import CvHeader from "./00_header/CvHeader";
import CvAboutSectionsRender from "./01_about/CvAboutSectionsRender";
import CvNavigation from "./navigation/CvNavigation";
import { Routes, Route } from "react-router-dom";

const CvRender = () => {
  return (
    <>
      <CvNavigation />
      <CvHeader />
      <Routes>
        <Route index path="/karaniewskicv" element={<CvAboutSectionsRender />} />
        <Route path="/karaniewskiportfolio" element={<CvAboutSectionsRender />} />
        <Route path="/karaniewskicontact" element={<CvAboutSectionsRender />} />
      </Routes>
    </>
  );
};

export default CvRender;
